THIS IS DANISH LANGUAGE HIP-HOP. YOU FOREIGNERS ARE FREE TO DOWNLOAD IT FOR THE BEATS, OR IF YOUR INTERESTED IN LEARNING THE DANISH LANGUAGE.

SCANDINAVIAN PEOPLE, READ ON:

Bestaar af EP (2003, 5 tracks) &amp; Den Svaere 2'er (2005, 9 tracks). Begge inspillet i Hipcat Studiet i Kolding.

Damp er en dansk hip-hop duo bestaaende af Dr. Skittlez &amp; Dr. Pagh. Trods studieaktivitet har vi vaeret stillestaaende siden 2006, men nu er der nye udgivelser paa vej, saa glaed jer! I den forbindelse ligger vi vores to foerste udgivelser gratis ud. Saa hvis du for en gangs skyld har lyst til at downloade gatis OG lovligt musik, saa har du her chancen ;)

